import React, { useState } from "react";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

function StudentForm() {
  const [form, setForm] = useState({
    name: "",
    email: "",
    password: "",
    studentId: "",
    education: "",
    major: "",
    duration: "",
    gender: "",
  });
  const [response, setResponse] = useState("");

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/api/submit", form);
      setResponse(" Form submitted successfully!");
      setForm({
        name: "",
        email: "",
        password: "",
        studentId: "",
        education: "",
        major: "",
        duration: "",
        gender: "",
      });
    } catch (err) {
      console.error(err);
      setResponse(" Failed to submit form");
    }
  };

  return (
    <div className="container mt-5">
      <h3 className="text-center mb-4">Student Registration Form</h3>

      <form onSubmit={handleSubmit} className="card p-4 shadow-lg">
        {/* Name */}
        <div className="mb-3">
          <label className="form-label">Full Name</label>
          <input
            className="form-control"
            name="name"
            value={form.name}
            onChange={handleChange}
            placeholder="Enter your full name"
            required
          />
        </div>

        {/* Email */}
        <div className="mb-3">
          <label className="form-label">Email</label>
          <input
            type="email"
            className="form-control"
            name="email"
            value={form.email}
            onChange={handleChange}
            placeholder="Enter your email"
            required
          />
        </div>

        {/* Password */}
        <div className="mb-3">
          <label className="form-label">Password</label>
          <input
            type="password"
            className="form-control"
            name="password"
            value={form.password}
            onChange={handleChange}
            placeholder="Enter your password"
            required
          />
        </div>

        {/* Student ID */}
        <div className="mb-3">
          <label className="form-label">Student ID</label>
          <input
            className="form-control"
            name="studentId"
            value={form.studentId}
            onChange={handleChange}
            placeholder="Enter your student ID"
          />
        </div>

        {/* Education */}
        <div className="mb-3">
          <label className="form-label">Education</label>
          <input
            className="form-control"
            name="education"
            value={form.education}
            onChange={handleChange}
            placeholder="e.g. Bachelor of Engineering"
          />
        </div>

        {/* Major */}
        <div className="mb-3">
          <label className="form-label">Major</label>
          <input
            className="form-control"
            name="major"
            value={form.major}
            onChange={handleChange}
            placeholder="e.g. Software Engineering"
          />
        </div>

        {/* Duration */}
        <div className="mb-3">
          <label className="form-label">Duration of Degree</label>
          <input
            className="form-control"
            name="duration"
            value={form.duration}
            onChange={handleChange}
            placeholder="e.g. 11/2021 - 12/2024"
          />
        </div>

        {/* Gender */}
        <div className="mb-3">
          <label className="form-label d-block">Gender</label>
          <div className="form-check form-check-inline">
            <input
              type="radio"
              name="gender"
              value="male"
              checked={form.gender === "male"}
              onChange={handleChange}
              className="form-check-input"
            />
            <label className="form-check-label">Male</label>
          </div>
          <div className="form-check form-check-inline">
            <input
              type="radio"
              name="gender"
              value="female"
              checked={form.gender === "female"}
              onChange={handleChange}
              className="form-check-input"
            />
            <label className="form-check-label">Female</label>
          </div>
        </div>

        <button className="btn btn-success w-100" type="submit">
          Submit Form
        </button>
      </form>

      {response && (
        <p className="mt-3 text-center fw-bold text-primary">{response}</p>
      )}
    </div>
  );
}

export default StudentForm;
